import React, { Component } from 'react';
import Home from './Home';
export default class Liveproduction extends Component {
  render() {
    return (
        <div className='cover'>
            <iframe src="https://docs.google.com/spreadsheets/d/19ZHhBTHtKiJqAxSzFJpOKaIyH7zcDuYySGS1pxXJW9s/edit" title="googlesheet"/>
        </div>
    );
  }
}
